import React, { ButtonHTMLAttributes } from 'react';
import { classes } from 'typestyle';

import { stylesheet } from 'typestyle';
import { NestedCSSProperties } from 'typestyle/lib/types';

const BUTTON_STYLES: NestedCSSProperties = {
    height: '20px',
    minWidth: '80px',
    fontWeight: 'bold',
    borderRadius: 4,
    borderStyle: 'none',
    padding: '8px',
};
const displayVariants = stylesheet({
    main: {
        ...BUTTON_STYLES,
        backgroundColor: 'gray',
        color: 'white',
    },
    outline: {
        ...BUTTON_STYLES,
        backgroundColor: 'transparent',
        color: 'darkblue',
        border: `2px solid darkblue`,
        borderStyle: 'solid',
        padding: '8px',
    },
    light: {
        ...BUTTON_STYLES,
        backgroundColor: 'transparent',
        color: CTA_COLOR,
    },
    cancel: {
        ...BUTTON_STYLES,
        backgroundColor: 'transparent',
        color: STRONG_INDICATOR_MAIN_COLOR,
        border: `2px ${STRONG_INDICATOR_MAIN_COLOR}`,
        borderStyle: 'solid',
    },
    disabled: {
        border: `2px solid ${BORDER_COLOR}`,
        color: BORDER_COLOR,
        backgroundColor: WHITE_COLOR,
        cursor: 'not-allowed !important',
    },
    mainLight: {
        ...BUTTON_STYLES,
        backgroundColor: 'transparent',
        color: WHITE_COLOR,
    },
});

type ButtonProps = ButtonHTMLAttributes<HTMLButtonElement> & {
    title: string;
};
// type ButtonProps = {
//     title: string;
//     className?: string;
//     disabled?: boolean;
// };
export function Button({ title, className, disabled = false, ...props }: ButtonProps) {
    return (
        <button className={classes(styles.button, className)} disabled={disabled} {...props}>
            {title}
        </button>
    );
}
